// --- FIXED FOR MERGE OUTPUT WITH FLAT FIELDS ---
// Input example: { Address: "...", output: "{...}" }

return $input.all().map(item => {
  const data = { ...item.json }; // make a shallow copy
  const rawOutput = data.output;

  // Remove the unwanted "output" field
  delete data.output;

  let latitude = null;
  let longitude = null;

  try {
    let raw = rawOutput;
    if (typeof raw === "string") {
      // Clean and parse the stringified JSON
      raw = raw.replace(/\\n/g, "")
               .replace(/\n/g, "")
               .replace(/\\/g, "")
               .trim();
      raw = JSON.parse(raw);
    }
    latitude = raw.latitude ?? raw.lat ?? null;
    longitude = raw.longitude ?? raw.lng ?? null;
  } catch (e) {
    // Regex fallback if JSON parsing fails
    const latMatch = String(rawOutput).match(/latitude["']?\s*[:=]\s*(-?\d+(\.\d+)?)/i);
    const lonMatch = String(rawOutput).match(/longitude["']?\s*[:=]\s*(-?\d+(\.\d+)?)/i);
    latitude = latMatch ? parseFloat(latMatch[1]) : null;
    longitude = lonMatch ? parseFloat(lonMatch[1]) : null;
  }

  // Return cleaned data + extracted lat/lon
  return {
    json: {
      ...data,       // original sheet fields (without "output")
      latitude,
      longitude
    }
  };
});

// Normalize and clean Google Sheets data for frontend use
// Ensures consistent keys and numeric coordinates

return $input.all().map(item => {
  const row = item.json;

  return {
    json: {
      name: row["Name"] || row["name"] || "",
      business_name: row["Business Name"] || row["business_name"] || "",
      type: row["Type"] || row["type"] || "",
      address: row["Address"] || row["address"] || "",
      email: row["Email"] || row["email"] || "",
      contact: row["Contact"] || row["contact"] || "",
      rates: row["Rates"] || row["rates"] || "",
      latitude: parseFloat(row["Latitude"] || row["latitude"] || 0),
      longitude: parseFloat(row["Longitude"] || row["longitude"] || 0)
    }
  };
});

// n8n Code node: parse nested JSON in "output" field
// Input:  [{ "output": "{\n  \"Full Address\": \"Dothan, Alabama\"\n}" }, ...]
// Output: [{ "Full Address": "Dothan, Alabama" }, { "Full Address": "Indianapolis, Indiana" }, ...]

return items.map(item => {
  try {
    // The AI sometimes returns stringified JSON with extra whitespace or newlines
    const clean = item.json.output.trim();

    // Attempt to parse the JSON text safely
    const parsed = JSON.parse(clean);

    // Return clean object
    return { json: parsed };
  } catch (err) {
    // If parsing fails, return the raw string so you can debug
    return { json: { error: "Invalid JSON format", raw: item.json.output } };
  }
});

// Extract the webhook input (first item) â€” contains the search parameters
const webhookData = $input.all()[0].json;

// Extract latitude, longitude, and radius from the webhook body
const centerLat = parseFloat(webhookData.body.latitude);
const centerLon = parseFloat(webhookData.body.longitude);
const radius = parseFloat(webhookData.body.radius);

if (isNaN(centerLat) || isNaN(centerLon) || isNaN(radius)) {
  throw new Error("Missing or invalid latitude, longitude, or radius in webhook body.");
}

// Get all sheet rows â€” these start from the 2nd item onward
const sheetRows = $input.all().slice(1);

// Haversine distance formula (in kilometers)
function haversine(lat1, lon1, lat2, lon2) {
  const R = 6371;
  const dLat = (lat2 - lat1) * Math.PI / 180;
  const dLon = (lon2 - lon1) * Math.PI / 180;
  const a =
    Math.sin(dLat / 2) ** 2 +
    Math.cos(lat1 * Math.PI / 180) *
    Math.cos(lat2 * Math.PI / 180) *
    Math.sin(dLon / 2) ** 2;
  return R * 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
}

// Filter by distance
const filtered = sheetRows.filter(item => {
  const rec = item.json;
  const lat2 = parseFloat(rec.latitude);
  const lon2 = parseFloat(rec.longitude);

  if (isNaN(lat2) || isNaN(lon2)) return false;

  const dist = haversine(centerLat, centerLon, lat2, lon2);
  return dist <= radius;
});

// Return filtered rows or message if empty
if (filtered.length === 0) {
  return [{ json: { message: "No results found within given radius." } }];
}

return filtered;

// Get webhook data
const payload = $items("Review")[0].json.body;  // adjust "Webhook1" if node name differs
const serial = String(payload.serial || "").trim();
const newFeedback = payload.feedback || "";
const newReview = payload.review || "";

// Get sheet rows
const rows = $items("Spreadsheet File").map(i => i.json);

let found = false;

// Update only Feedback + Review for matching Serial No.
for (const row of rows) {
  if (String(row["Serial No."]).trim() === serial) {
    row.Feedback = newFeedback;
    row.Review = newReview;
    found = true;
  }
}

if (!found) {
  throw new Error(`No match found for Serial No. ${serial}`);
}

// Return all rows to overwrite the sheet
return rows.map(r => ({ json: r }));

