function getFullAddress(state, address) {
  // State Abbreviation Handling
  const stateNames = {
    "UT": "Utah",
    "WA": "Washington",
    "NY": "New York",
    // Add more state abbreviations as needed
  };
  state = stateNames[state.toUpperCase()] || state;

  // Special Address Cases
  const specialCases = {
    "Entire State": getLargestCity(state),
    "Some Parts of": getLargestCity(state),
    "Remote": getLargestCity(state),
    "Remote Only": getLargestCity(state),
    "Out of State": getLargestCity(state),
    "Out of State â€“ Remote Only": getLargestCity(state),
  };
  if (Object.keys(specialCases).some(phrase => address.toLowerCase().includes(phrase))) {
    return {
      "Full Address": `${specialCases[address.toLowerCase().match(/(Entire|Some|Remote|Out of State).*?/)[1]]}, ${state}`
    };
  }

  // Normal Combination
  if (address) {
    return {
      "Full Address": `${address}, ${state}`
    };
  }

  // Unknown or Blank Addresses
  return {
    "Full Address": getLargestCity(state) + ", " + state
  };
}

function getLargestCity(state) {
  // This function should return the largest city in the given state
  // For simplicity, we'll use a hardcoded list of cities for now
  const cities = {
    "UT": "Salt Lake City",
    "WA": "Seattle",
    "NY": "New York",
    // Add more cities as needed
  };
  return cities[state] || "State Capital";
}

// Example usage
console.log(getFullAddress("WA", "Entire State")); // Output: {"Full Address": "Seattle, Washington"}
console.log(getFullAddress("TX", "Remote Only")); // Output: {"Full Address": "Houston, Texas"}
console.log(getFullAddress("NY", "Out of State - Remote Only")); // Output: {"Full Address": "New York, New York"}
